import React, { Fragment, useEffect, useState } from "react";
import "./Components.css";
import axios from "axios";

function CourseTable() {
  const [courses, setCourses] = useState();

  useEffect(() => {
    axios.get("http://localhost:5000/courses").then(function (response) {
      console.log(response);
      setCourses(response.data);
    });

    setCourses();
  }, []);

  console.log(courses);

  var courseItems;
  if (courses) {
    courseItems = courses.map((course) => {
      var lab, exam, lab, project, upg, ktr, hem, bas;
      var keys = [exam, lab, project, upg, ktr, hem, bas];
      var keys_string = ["exam", "lab", "project", "upg", "ktr", "hem", "bas"];

      Object.keys(course).forEach(function (key, index) {
        if (keys_string.includes(key) && course[key]) {
          var index_key = keys_string.indexOf(key);
          console.log(index_key);
          keys[index_key] = "X";
          console.log(keys[index_key]);
        }
      });

      return (
        <tr>
          <td>
            <div className="form-check">
              <input
                class="form-check-input"
                type="checkbox"
                id="inlineCheckbox1"
                value="option1"
              />
            </div>
          </td>
          <td>{course.code}</td>
          <td>{course.name}</td>
          <td>{course.points}</td>
          <td>{course.level}</td>
          <td>{course.block}</td>
          <td>{course.vof}</td>
          <td>{keys[exam]}</td>
          <td>{keys.lab}</td>
          <td>{keys.project}</td>
          <td>{upg}</td>
          <td>{ktr}</td>
          <td>{hem}</td>
          <td>{bas}</td>
        </tr>
      );
    });
  }

  return (
    <div>
      <table className="table table-sm">
        <thead>
          <tr>
            <th scope="col">Check</th>
            <th scope="col">Kurskod</th>
            <th scope="col">Kurs</th>
            <th scope="col">Hp</th>
            <th scope="col">Nivå</th>
            <th scope="col">Block</th>
            <th scope="col">VOF</th>
            <th scope="col">TEN</th>
            <th scope="col">LAB</th>
            <th scope="col">PRA</th>
            <th scope="col">UPG</th>
            <th scope="col">KTR</th>
            <th scope="col">HEM</th>
            <th scope="col">BAS</th>
          </tr>
        </thead>
        <tbody>{courseItems}</tbody>
      </table>
    </div>
  );
}

function getCourses() {}

export default CourseTable;
